Message:
Within db.js and tests, get Firefox to avoid errors (preventDefault, move error execution from onupgradeneeded to onsuccess, lengthen test timeouts, wrap `delete` onblocked event's `newVersion` with Proxy but avoid using using Proxy if not present for sake of PhantomJS or older browsers);
fix/improve comment wrapper for `oldVersion` and avoid testing (can't be wrapped (at least not readily) and not our API anyways), but do test `err.type` is `blocked`
improve test grouping/naming

Allow empty string index;
reject cursor.update errors (and test);
const/let grouping;
validate limit() arguments (and test);
add tests for bad query indexes, bad ranges with other cursor types;
move query tests to that section

Catch bad filters (and test); allow for non-objects;
Allow non-objects to add/update;
Add timeout for Firefox on test groups in server-add/server-update
